import PortfolioContainer from '../src/ProfileContainer/Home/PortfolioContainer'
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import './App.css';
import { GoogleLogin } from 'react-google-login';
import { gapi } from 'gapi-script'
import React,{useE} from 'react';

function App() {
  return (
    <div className="App">
      <ToastContainer/>
    <PortfolioContainer/>

    </div>
  );

const clientId = '956581281889-8ne7v6sl5ebm0jmceoc59utqqde77b4b.apps.googleusercontent.com'

useEffect(() => {
   const initClient = () => {
         gapi.client.init({
         clientId: clientId,
         scope: ''
       });
    };
    gapi.load('client:auth2', initClient);
});
const onSuccess = (res) => {
  console.log('success:', res);
};
const onFailure = (err) => {
  console.log('failed:', err);
};
return (
 <GoogleLogin
    clientId={clientId}
    buttonText="Sign in with Google"
    onSuccess={onSuccess}
    onFailure={onFailure}
    cookiePolicy={'single_host_origin'}
    isSignedIn={true}
/>
);
}

export default App;
